import React from 'react';
import projectElements from "../assets/projectElements";

export default function ProjectCard() {
    return (
        <div className="container mx-auto px-4 py-8">
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
                {projectElements.slice(0, 3).map((element) => (
                    <div key={element.id} className="group bg-[#2b2b2b] p-6 rounded-lg shadow-lg hover:bg-white transition duration-300 ease-in-out transform hover:-translate-y-2 hover:border-4 hover:border-gray-400 w-full">
                        <a href={element.a} target="_blank" rel="noopener noreferrer">
                            <div className="servic-thumb">
                                <i className={`${element.icon} text-3xl text-white group-hover:text-black`}></i>
                                <h1 className="font-sans text-white text-lg font-normal mt-4 tracking-wide group-hover:text-black">
                                    {element.title}
                                </h1>
                                <p className="font-sans text-[#696969] text-sm font-light mt-2 mb-4 tracking-wide group-hover:text-black">
                                    {element.description}
                                </p>
                                <div className="flex flex-wrap mt-4">
                                    {element.tech.map((tech, index) => (
                                        <span
                                            key={index}
                                            className="font-sans mr-2 mb-2 px-3 py-1 border border-gray-300 rounded-full bg-gray-700 text-gray-300 text-xs font-light tracking-wide group-hover:bg-gray-300 group-hover:text-black"
                                        >
                                            {tech}
                                        </span>
                                    ))}
                                </div>
                            </div>
                        </a>
                    </div>
                ))}
            </div>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
                {projectElements.slice(3).map((element) => (
                    <div key={element.id} className="group bg-[#2b2b2b] p-6 rounded-lg shadow-lg hover:bg-white transition duration-300 ease-in-out transform hover:-translate-y-2 hover:border-4 hover:border-gray-400 w-full">
                        <a href={element.a} target="_blank" rel="noopener noreferrer">
                            <div className="servic-thumb">
                                <i className={`${element.icon} text-3xl text-white group-hover:text-black`}></i>
                                <h1 className="font-sans text-white text-lg font-normal mt-4 tracking-wide group-hover:text-black">
                                    {element.title}
                                </h1>
                                <p className="font-sans text-[#696969] text-sm font-light mt-2 mb-4 tracking-wide group-hover:text-black">
                                    {element.description}
                                </p>
                                <div className="flex flex-wrap mt-4">
                                    {element.tech.map((tech, index) => (
                                        <span
                                            key={index}
                                            className="font-sans mr-2 mb-2 px-3 py-1 border border-gray-300 rounded-full bg-gray-700 text-gray-300 text-xs font-light tracking-wide group-hover:bg-gray-300 group-hover:text-black"
                                        >
                                            {tech}
                                        </span>
                                    ))}
                                </div>
                            </div>
                        </a>
                    </div>
                ))}
            </div>
        </div>
    );
}
